//functions
void Render64x64Tile_4b(char gfx[], short lut[], u8 x, u8 y)
{
	//load texture
	gDPSetTextureLUT(glistp++, G_TT_RGBA16);// We’re using a TLUT
	gDPLoadTLUT_pal16(glistp++, 0, lut);// Load the TLUT
	
	//prepare sprite
	gDPLoadTextureBlock_4b(glistp++, 
	gfx,
	G_IM_FMT_CI,                              // fmt
	64, 64,                                   // width, height
	0,                                        // pal
	G_TX_MIRROR, G_TX_MIRROR,                   // cms, cmt
	G_TX_NOMASK, G_TX_NOMASK,                 // masks, maskt
	G_TX_NOLOD, G_TX_NOLOD                    // shifts, shiftt
	);
	
	//render sprite
	gSPTextureRectangle(glistp++, 
	x<<2, y<<2, 
	(x + 64)<<2, (y + 64)<<2,
	G_TX_RENDERTILE, 
	0 << 5, 0 << 5, 
	1 << 10, 1 << 10);
	gDPPipeSync(glistp++);
}

//test draw function
void DrawSlide(u8 slideIndex)
{
	u8 x = 32,y = 24;
	//prepare rendering genrally foor 2d sprite rendering
	gDPSetCycleType(glistp++, G_CYC_1CYCLE);
	gDPSetCombineMode(glistp++, G_CC_DECALRGBA, G_CC_DECALRGBA);
    //gDPSetRenderMode(glistp++, G_RM_AA_ZB_TEX_EDGE, G_RM_AA_ZB_TEX_EDGE);
	gDPSetRenderMode(glistp++, G_RM_ZB_XLU_SURF, G_RM_ZB_XLU_SURF);
    gDPSetDepthSource(glistp++, G_ZS_PRIM);
    gDPSetPrimDepth(glistp++, 0, 0);
    gDPSetTexturePersp(glistp++, G_TP_NONE);
	
	
	//load textures, render  and render sprites
	if(slideIndex == 0)
	{
		Render64x64Tile_4b(BrewLogo1, BrewLogo1_tlut, 96, 56);
		Render64x64Tile_4b(BrewLogo2, BrewLogo2_tlut, 96+64, 56);
		Render64x64Tile_4b(BrewLogo3, BrewLogo3_tlut, 96, 56+64);
		Render64x64Tile_4b(BrewLogo4, BrewLogo4_tlut, 96+64, 56+64);
	}
	else if(slideIndex == 1)
	{
		Render64x64Tile_4b(Team_1, Team_1_tlut, 64, 24+64);
		Render64x64Tile_4b(Team_2, Team_2_tlut, 64+64, 24+64);
		Render64x64Tile_4b(Team_3, Team_3_tlut, 64+128, 24+64);
	}	
	else if(slideIndex == 2)
	{
		//x = 32,y = 24;//sprite position
		Render64x64Tile_4b(Intro_grid_corner, Intro_grid_tlut, 32, 24);//upper left corner
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32+64, 24);//upper border
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32+128, 24);//upper boarder
		Render64x64Tile_4b(Intro_grid_corner, Intro_grid_tlut, 32+192, 24);//upper right corner
		
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32, 24+64);//left corner
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32+64, 24+64);//centre
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32+128, 24+64);//centre
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32+192, 24+64);//right corner
		
		Render64x64Tile_4b(Intro_grid_corner, Intro_grid_tlut, 32, 24+128);//lower left corner
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32+64, 24+128);//lower border
		Render64x64Tile_4b(Intro_grid_center, Intro_grid_tlut, 32+128, 24+128);//lower boarder
		Render64x64Tile_4b(Intro_grid_corner, Intro_grid_tlut, 32+192, 24+128);//lower right corner
	}	
		
	//done
	//gDPPipeSync(glistp++);                        // Sync the pipeline
	//gDPSetTextureLUT(glistp++, G_TT_NONE);        // Stop using a TLUT 
}
  

